import Option from "./Option/Option";


const Select =(props)=>{
    return(
        <>  
            <select class="form-select" aria-label="Default select" disabled={props.disabled}>
              {
                props.value.map((value)=>{
                    return <Option value={value} option_name={value}/>
                })
              }
             </select>
        </>
    )
}
export default Select;
